import PropTypes from 'prop-types';
import '../styles/Navbar.scss'

const Navbar = (props) => (
<div id="nav">
    <a href="javascript: void(0)" className="closeBtn" onClick={() => props.onCloseNav()}>
        &times;
    </a>
    <div className="overlay-content">
        <a href="#">Catalogs</a>
        <a href="#">Cars</a>
        <a href="#">Create a Catalog</a>
        <a href="#">Create a Car</a>
    </div>
</div>
);

Navbar.propTypes = {
    onCloseNav: PropTypes.func
}
export default Navbar;
